  const smoothRotation = useSpring(rotation, { stiffness: 400, damping: 90 });

  const cursorX = useMotionValue(0);
  const cursorY = useMotionValue(0);
  const irisRotationX = useTransform(cursorX, [-10, 168.9], [-40, 40]);
